import axios from 'axios';
import { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';

function Register() {
  const [formData, setFormData] = useState({ name: '', email: '', password: '', role: 'tenant' });
  const [status, setStatus] = useState('');
  const [error, setError] = useState({});
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
    // Clear error when user types
    if (error[name]) {
      setError({ ...error, [name]: '' });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setStatus('');
    setError({});

    try {
      const response = await axios.post('http://localhost:5000/api/auth/register', formData);
      localStorage.setItem('user', JSON.stringify(response.data.user));
      localStorage.setItem('token', response.data.token);

      // Navigate based on role
      const role = response.data.user.role;
      if (role === 'admin') {
        navigate('/admin');
      } else if (role === 'landlord') {
        navigate('/landlord');
      } else {
        navigate('/tenant');
      }
    } catch (err) {
      if (err.response) {
        // Server responded with an error
        if (err.response.data.field) {
          setError({ [err.response.data.field]: err.response.data.message });
        } else {
          setStatus(err.response.data.message || 'Registration failed');
        }
      } else {
        setStatus('Network error. Please try again.');
      }
    }
  };

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <h1 className="text-3xl font-bold text-gray-900 mb-6 text-center">Register</h1>
      <div className="bg-white shadow-lg rounded-lg p-6 max-w-md mx-auto">
        <form onSubmit={handleSubmit} className="space-y-4">
          <div>
            <label className="block text-sm font-medium text-gray-700">Name</label>
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              className={`mt-1 block w-full border-gray-300 rounded-md shadow-sm ${error.name ? 'border-red-500' : ''}`}
              required
            />
            {error.name && <p className="mt-1 text-sm text-red-600">{error.name}</p>}
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Email</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              className={`mt-1 block w-full border-gray-300 rounded-md shadow-sm ${error.email ? 'border-red-500' : ''}`}
              required
            />
            {error.email && <p className="mt-1 text-sm text-red-600">{error.email}</p>}
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Password</label>
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              className={`mt-1 block w-full border-gray-300 rounded-md shadow-sm ${error.password ? 'border-red-500' : ''}`}
              required
            />
            {error.password && <p className="mt-1 text-sm text-red-600">{error.password}</p>}
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Role</label>
            <select
              name="role"
              value={formData.role}
              onChange={handleChange}
              className="mt-1 block w-full border-gray-300 rounded-md shadow-sm"
            >
              <option value="tenant">Tenant</option>
              <option value="landlord">Landlord</option>
              <option value="admin">Admin</option>
            </select>
          </div>
          <button
            type="submit"
            className="w-full bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700"
          >
            Register
          </button>
        </form>
        {status && <p className="mt-4 text-sm text-red-600 text-center">{status}</p>}
        <p className="mt-4 text-sm text-gray-600 text-center">
          Already have an account? <Link to="/login" className="text-blue-600 hover:underline">Login</Link>
        </p>
      </div>
    </div>
  );
}

export default Register;
